import React from 'react';

const PendingModalBody = () => {
  return (
    <div>
      <h3>잠정 가입 상태입니다</h3>
      <p>학생이 아직 줌 미팅을 등록하지 않았어요.</p>
    </div>
  );
};

export default PendingModalBody;
